import React from 'react';

const TravelInfo = () => {
  return (
    <div style={{ backgroundColor: '#a8009c', padding: '2rem' }}>
      <div
        style={{
          backgroundColor: '#fff',
          padding: '2rem',
          borderRadius: '8px',
          maxWidth: '700px',
          margin: '0 auto',
        }}
      >
        <h2 style={{ color: '#000', fontSize: '24px' }}>Travel Information</h2>
        <p style={{ fontSize: '16px', marginTop: '0.5rem' }}>
          Find essential travel information to prepare for your journey.
        </p>
        <a
          href="#"
          style={{
            color: '#0078d4',
            textDecoration: 'none',
            fontWeight: 'bold',
            display: 'inline-block',
            marginTop: '1rem',
          }}
        >
          Learn More
        </a>
      </div>
    </div>
  );
};

export default TravelInfo;
